css:
.scrollbars-visible-always .markdown-preview atom-text-editor .vertical-scrollbar,
.scrollbars-visible-always .markdown-preview atom-text-editor .horizontal-scrollbar {
  visibility: hidden;
}
.scrollbars-visible-always .markdown-preview atom-text-editor:hover .vertical-scrollbar,
.scrollbars-visible-always .markdown-preview atom-text-editor:hover .horizontal-scrollbar {
  visibility: visible;
}
.markdown-preview del {
  text-decoration: none;
  position: relative;
}
.markdown-preview del::after {
  border-bottom: 1px solid black;
  content: "";
  left: 0;
  position: absolute;
  right: 0;
  top: 50%;
}
.markdown-preview .flash {
  -webkit-animation: flash 1s ease-out;
  -webkit-animation-iteration-count: 1;
  outline: 1px solid rgba(255, 0, 0, 0);
}
.markdown-preview .flash:not(li) {
  display: block;
}
@-webkit-keyframes flash {
  0% {
    outline-color: rgba(255, 0, 0, 0);
  }
  50% {
    outline-color: #ff0000;
  }
  100% {
    outline-color: rgba(255, 0, 0, 0);
  }
}
.markdown-spinner {
  margin: auto;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
